import React from "react";

const Header = ({ children }) => {
  return (
    <>
      <div style={{ width: "100%", height: "104px", background: "blue" }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            gap: "30px",
          }}
        >
          <a href='/' style={{textDecoration: 'none', color:'black'}}>Acasa</a>
          <a href='/anunturi' style={{textDecoration: 'none', color:'black'}}>Anunturi</a>
          <a href='/examene' style={{textDecoration: 'none', color:'black'}}>Examene</a>
          <a>Catalog</a>
        </div>
      </div>
      <div style={{ height: "100%-104px" }}>{children}</div>
    </>
  );
};

export default Header;
